import logo from './logo.svg';
import app from "./firebase";
import './App.css';
import GoogleLogin from 'react-google-login';
// let clientId = "1098019005957-m2sjfa61abn8dsb8tk0eplog0dbsqi5d.apps.googleusercontent.com";
let clientId = "1098019005957-m2sjfa61abn8dsb8tk0eplog0dbsqi5d.apps.googleusercontent.com";


function App() {

	const responseGoogle = (a) =>{
		console.log("Hello", a)

		app.collection("customersData").add({
			name: "hello",
			password: "hi",
		});
	}

	const responseGoogle1 = (a) =>{
		console.log("Hello1", a)
	}

	return (
		<div className="App">
			<header className="App-header">
				<img src={logo} className="App-logo" alt="logo" />
				<p>
					Edit <code>src/App.js</code> and save to reload.
				</p>
				<a
					className="App-link"
					href="https://reactjs.org"
					target="_blank"
					rel="noopener noreferrer"
				>
					Learn React
				</a>
				<GoogleLogin
					clientId={clientId}
					buttonText="Login"
					onSuccess={responseGoogle}
					onFailure={responseGoogle1}
					cookiePolicy={'single_host_origin'}
				/>
			</header>
		</div>
	);
}

export default App;
